INSERT INTO `pages` (`id`, `project_id`, `title`, `slug`, `content`, `system`, `sort`, `display`, `hidden`) VALUES
(1, 1, 'Witamy na wspaniaej stronie!', 'index', '<section class=\"jumbotron text-center\"><img style=\"width: 100%;\" src=\"../../../../../../img/volunteering.png\" /> <br /><br /><br />\r\n<h1 class=\"jumbotron-heading\">O projekcie</h1>\r\n<p class=\"lead text-muted\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\r\n<br /><br /><a href=\"../../../../../../global/index/page/show/register\"><button class=\"btn btn-success btn-lg\" type=\"button\">Zarejestruj si ju teraz</button></a></section>', 1, 0, 1, 0),
(3, 1, 'Rejestracja projektu', 'register', '<section class=\"jumbotron text-center\">\r\n        <div class=\"container\">\r\n		  <img src=\"/img/volunteering.png\" style=\"width:100%\"/>\r\n          <br><br><br>\r\n		  <h1 class=\"jumbotron-heading\">Zasady i proces rejestracji</h1>\r\n          <p class=\"lead text-muted\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\r\n        </div>\r\n      </section>\r\n\r\n\r\n      <!-- Marketing messaging and featurettes\r\n      ================================================== -->\r\n      <!-- Wrap the rest of the page in another container to center all the content. -->\r\n\r\n	  \r\n	  \r\n      <div class=\"container marketing\">\r\n			<h1 class=\"jumbotron-heading\">Formularz rejestracyjny</h1>\r\n			<br><br>\r\n			<form class=\"needs-validation\" novalidate>\r\n  <div class=\"form-row\">\r\n    <div class=\"col-md-4 mb-3\">\r\n      <label for=\"validationCustom01\">Login</label>\r\n      <input type=\"text\" class=\"form-control\" id=\"validationCustom01\" placeholder=\"Login\" value=\"\" required>\r\n      <div class=\"invalid-feedback\">\r\n        Wybrany login nie jest poprawny!\r\n      </div>\r\n      <div class=\"valid-feedback\">\r\n        Ok!\r\n      </div>\r\n    </div>\r\n    <div class=\"col-md-4 mb-3\">\r\n      <label for=\"validationEmail\">E-mail</label>\r\n      <div class=\"input-group\">\r\n        <div class=\"input-group-prepend\">\r\n          <span class=\"input-group-text\" id=\"inputGroupPrepend\">@</span>\r\n        </div>\r\n        <input type=\"email\" class=\"form-control\" id=\"validationEmail\" placeholder=\"E-mail\" aria-describedby=\"inputGroupPrepend\" required>\r\n        <div class=\"invalid-feedback\">\r\n          Wprowadzony adres e-mail nie jest poprawny!\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"form-row\">\r\n    <div class=\"col-md-4 mb-3\">\r\n      <label for=\"validationCustom02\">Haso</label>\r\n      <input type=\"password\" class=\"form-control\" id=\"validationCustom02\" placeholder=\"Haso\" required>\r\n      <div class=\"invalid-feedback\">\r\n        Haso nie spenia podstawowych wymaga.\r\n      </div>\r\n    </div>\r\n    <div class=\"col-md-4 mb-3\">\r\n      <label for=\"validationCustom03\">Powtrz haso</label>\r\n      <input type=\"password\" class=\"form-control\" id=\"validationCustom03\" placeholder=\"Powtrz haso\" required>\r\n      <div class=\"invalid-feedback\">\r\n        Wprowadzone has nie s takie same.\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"form-row\">\r\n    <div class=\"col-md-8 mb-3\">\r\n      <label for=\"validationCustom04\">Nazwa organizacji</label>\r\n      <input type=\"text\" class=\"form-control\" id=\"validationCustom04\" placeholder=\"Nazwa organizacji\" required>\r\n      <div class=\"invalid-feedback\">\r\n        Nazwa organizacji nie jest poprawna\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"form-row\">\r\n    <div class=\"col-md-8 mb-3\">\r\n      <label for=\"validationDescription\">Opis organizacji<br />\r\n	  <small class=\"text-muted font-italic\">Czym zajmuje si organizacja? Do jakich celw potrzebuje wolontaroiszy?<br />Im wicej szczegw, tym atwiej nam bdzie zweryfikowa czy pasuje ona do naszych standardw.</small></label>\r\n	  <textarea name=\"content\" class=\"form-control\" id=\"validationDescription\" placeholder=\"Opis organizacji\" required></textarea>\r\n      <div class=\"invalid-feedback\">\r\n        Opis organizacji jest zbyt krtki...\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"form-group\">\r\n    <div class=\"form-check\">\r\n      <input class=\"form-check-input\" type=\"checkbox\" value=\"\" id=\"invalidCheck\" required>\r\n      <label class=\"form-check-label\" for=\"invalidCheck\">\r\n        Potwierdzam, e zapoznaem si z <a href=\"#\">regulaminem</a> i <a href=\"#\">polityk prywatnoci<a/>.\r\n      </label>\r\n      <div class=\"invalid-feedback\">\r\n        Musisz potwierdzi, e zapoznae si z regulaminem i polityk prywatnoci\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class=\"form-row\">\r\n    <div class=\"col-md-8 mb-3\">\r\n		<button class=\"btn btn-primary float-right\" type=\"submit\">Wylij zgoszenie</button>\r\n    </div>\r\n  </div>\r\n</form>\r\n\r\n<script>\r\n// Example starter JavaScript for disabling form submissions if there are invalid fields\r\n(function() {\r\n  \'use strict\';\r\n  window.addEventListener(\'load\', function() {\r\n    // Fetch all the forms we want to apply custom Bootstrap validation styles to\r\n    var forms = document.getElementsByClassName(\'needs-validation\');\r\n    // Loop over them and prevent submission\r\n    var validation = Array.prototype.filter.call(forms, function(form) {\r\n      form.addEventListener(\'submit\', function(event) {\r\n        if (form.checkValidity() === false) {\r\n          event.preventDefault();\r\n          event.stopPropagation();\r\n        }\r\n        form.classList.add(\'was-validated\');\r\n      }, false);\r\n    });\r\n  }, false);\r\n})();\r\n</script>\r\n\r\n        <hr class=\"featurette-divider\">\r\n', 1, 1, 1, 0),
